CREATE TABLE "todos" ("id" integer primary key autoincrement not null, "user_id" integer not null, "title" varchar not null, "description" text, "status" varchar check ("status" in ('pending', 'completed', 'in_progress')) not null default 'pending', "priority" varchar check ("priority" in ('low', 'medium', 'high')), "due_date" datetime, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade);

CREATE TABLE "users" ("id" integer primary key autoincrement not null, "first_name" varchar not null, "last_name" varchar not null, "email" varchar not null, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime);


